import React from 'react';
import Iframe from 'react-iframe';
import './project.css';

const Project = () => {
    return (
        <div>
         
        <Iframe url="https://charlielaver.github.io/netflix-in-react-deploy/"
        frameBorder="0"
        className="project"
        display="initial"
        position="relative"/>

       <Iframe url="https://charlielaver.github.io/rba-react-deploy/"
        frameBorder="0"
        className="project"
        display="initial"
        position="relative"/>

    </div>
    )
}

export default Project
